// src/pages/NatSettingsPage.jsx
import React, { useEffect, useState } from "react";
import axios from "axios";

function NatSettingsPage() {
  const [interfaces, setInterfaces] = useState([]);
  const [wanInterface, setWanInterface] = useState("");
  const [lanInterface, setLanInterface] = useState("");
  const [natEnabled, setNatEnabled] = useState(false);

  useEffect(() => {
    fetchInterfaces();
    fetchNatStatus();
  }, []);

  // Interface listesini çekip <select> dropdown için kullanacağız
  const fetchInterfaces = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://127.0.0.1:8000/network/interfaces", {
        headers: { Authorization: `Bearer ${token}` }
      });
      setInterfaces(res.data);
    } catch (err) {
      console.error(err);
      alert("Arayüzleri çekerken hata: " + err.message);
    }
  };

  // NAT durumunu /nat endpointinden al
  const fetchNatStatus = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://127.0.0.1:8000/nat", {
        headers: { Authorization: `Bearer ${token}` }
      });
      if (res.data) {
        setNatEnabled(res.data.enabled);
        setWanInterface(res.data.wan || "");
        setLanInterface(res.data.lan || "");
      }
    } catch (err) {
      console.log("NAT durumu alınamadı:", err.message);
      // not found vs. olabilir, ilk kullanım
    }
  };

  const handleSave = async (e) => {
    e.preventDefault();
    if (!wanInterface || !lanInterface) {
      alert("WAN ve LAN arayüzlerini seçmelisiniz!");
      return;
    }
    try {
      const token = localStorage.getItem("token");
      const body = {
        enabled: natEnabled,
        wan: wanInterface,
        lan: lanInterface
      };
      // /nat endpointine patch
      const res = await axios.patch("http://127.0.0.1:8000/nat", body, {
        headers: { Authorization: `Bearer ${token}` }
      });
      alert("NAT ayarı güncellendi. " + (res.data.message || ""));
    } catch (err) {
      console.error(err);
      alert("NAT ayarı kaydedilemedi: " + (err.response?.data?.detail || err.message));
    }
  };

  return (
    <div>
      <h2 className="dashboard-title">NAT Ayarları (ICS)</h2>

      <div className="card">
        <div className="card-header">LAN - WAN NAT Yönetimi</div>
        <div className="card-body">
          <form onSubmit={handleSave}>
            <div className="mb-3">
              <label className="form-label">WAN Interface (İnternetli)</label>
              <select
                className="form-select"
                value={wanInterface}
                onChange={(e) => setWanInterface(e.target.value)}
              >
                <option value="">Seçiniz</option>
                {interfaces.map((inf) => (
                  <option key={inf.interface_name} value={inf.interface_name}>
                    {inf.interface_name}
                  </option>
                ))}
              </select>
            </div>
            <div className="mb-3">
              <label className="form-label">LAN Interface (İç Ağa Dağıtılacak)</label>
              <select
                className="form-select"
                value={lanInterface}
                onChange={(e) => setLanInterface(e.target.value)}
              >
                <option value="">Seçiniz</option>
                {interfaces.map((inf) => (
                  <option key={inf.interface_name} value={inf.interface_name}>
                    {inf.interface_name}
                  </option>
                ))}
              </select>
            </div>

            <div className="mb-3 form-check">
              <input
                type="checkbox"
                className="form-check-input"
                id="chkNat"
                checked={natEnabled}
                onChange={(e) => setNatEnabled(e.target.checked)}
              />
              <label htmlFor="chkNat" className="form-check-label">
                NAT Etkin/Pasif (Internet Connection Sharing)
              </label>
            </div>

            <button type="submit" className="btn btn-primary">Kaydet</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default NatSettingsPage;
